import {gql} from 'apollo-boost'
import {graphql} from 'react-apollo';


const getEmpresas= 
gql`
{
  empresas{
    nombre,
    distrito,
    correo,
    canton,
    provincia
    }
  }
  `;

const ADD_BOOK = gql`

mutation addEmpresa{ 
  addListing(
    nombre:String!,
  distrito: "Aguas",
  correo: "gmail",
  provincia:"Alajuela",
  canton:"SanCarlos"  
  ){
    nombre,distrito,correo,provincia,canton
  }
}
  mutation AddBook(
      $isbn: String!,
      $title: String!,
      $author: String!,
      $description: String!,
      $publisher: String!,
      $published_year: Int!) {
      addBook(
          isbn: $isbn,
          title: $title,
          author: $author,
          description: $description,
          publisher: $publisher,
          published_year: $published_year) {
          _id
      }
  }
`;
  export default (getEmpresas);
